import Data.List (intercalate, transpose)
import Helpers.Table (tableByAntidiagonals, triangleByRows, indicesByAntidiagonals, triangularize, antidiagonalize, formatTable)
tabfUlarize :: [Int] -> [a] -> [[a]]
tabfUlarize = recurse where
  recurse [] _ = []
  recurse _ [] = []
  recurse (n:ns) as = b : recurse ns e where (b,e) = splitAt n as

-- This just makes a table pretty.
-- formatTable :: Show a => [[a]] -> [String]
formatTable' as = putStrLn $ Data.List.intercalate "\n" $ map (Data.List.intercalate ", " . take 11 . zipWith pad lengths) as where
  lengths = map maximum $ transpose $ map (map (length . show)) as
  pad n a = replicate (n - length a') ' ' ++ a' where
    a' = show a

printTable = formatTable' $ take 10 $ tabfUlarize triangularNumbers a008302_list where
  triangularNumbers = map (\i -> 1 + i*(i+1) `div` 2) [0..]

